import React, {Component } from 'react';
import { LineChart, Line, XAxis, YAxis, CartesianGrid, Tooltip, Legend, ResponsiveContainer } from 'recharts';

const data = [];

for (let num = 500; num >= 0; num--) {
    data.push({
        y: Math.floor(Math.random() * (400 - 180 + 1)) + 180
       
    });
   
}
for (let i = 0; i < 10; i++) {
    this.state.TempList.push(data[i]);
}

class ECG extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            TempList: []
        };
    }

    
    render() {
        return (
            <ResponsiveContainer width="50%" height="100%">
                <LineChart width={300} height={80} data={this.TempList}>
                    <Line type="monotone" dataKey="y" stroke="#8884d8" strokeWidth={3} dot={false} />
                    <CartesianGrid opacity={1} vertical={false} />

                    <YAxis />
                </LineChart>
            </ResponsiveContainer>
        );
    }
}
export default ECG;
